INSERT INTO VOYQUERY VALUES (229,8,'SELECT * WHERE {?poi dbpedia-owl:abstract ?abstract_en. FILTER (lang(?abstract_en) = ''en'') ?poi rdfs:label ?label_en. FILTER (lang(?label_en) = ''en'') OPTIONAL{?poi dbpedia-owl:abstract ?abstract_zh. FILTER (lang(?abstract_zh) = ''zh'')} OPTIONAL{?poi rdfs:label ?label_zh. FILTER (lang(?label_zh) = ''zh'')} OPTIONAL {?poi geo:lat ?latitude. ?poi geo:long ?longtitue.} OPTIONAL {?poi dbpedia-owl:elevation ?elevation} OPTIONAL {?poi dbpedia-owl:utcOffset ?timezone} OPTIONAL {?poi foaf:homepage ?homepage.} OPTIONAL{?poi foaf:isPrimaryTopicOf ?wikipage.} }','dbpedia-owl;rdfs;foaf;geo',1,'poi','abstract_en;label_en;abstract_zh;label_zh;latitude;longtitue;elevation;timezone;homepage;wikipage','','Select basic attributes of a POI');
INSERT INTO VOYQUERY VALUES (230,8,'SELECT ?link WHERE{?poi dbpedia-owl:wikiPageExternalLink ?link}','dbpedia-owl',1,'poi','link','','Select external links of a POI');
